(function () {
    'use strict';

    function createButton({ text = "Button", styles = {} } = {}) {
        const button = document.createElement("button"); // 创建一个按钮
        button.textContent = text; // 按钮内容
        // 设置默认样式
        const defaultStyles = {
            width: "100px",
            height: "50px",
            align: "center", //文本居中
            color: "white", //按钮文字颜色
            backgroundColor: "#e33e33", //按钮底色
            border: "1px solid #e33e33", //边框属性
            position: 'absolute',
            zIndex: 9999
        };
        // 合并默认样式和传入的样式
        const finalStyles = Object.assign({}, defaultStyles, styles);
        // 使用 Object.assign 批量设置样式
        Object.assign(button.style, finalStyles);
        return button;
    }

    const btn = createButton({
        text: "点击3s后开始", //按钮内容
        styles: {
            borderRadius: "4px", //按钮四个角弧度
            left: "60px",
            top: "60px"
        }
    });
    btn.addEventListener("click", clickBotton) //监听按钮点击事件

    console.log('===> 脚本开始工作，加载中')
    let noStudyText = '' // 用于记录长时间发呆提示框的文本
    let btnTipTimes = 0; // 用于记录点击“下一个”的次数，避免一直点
    function clickNextBtn() {
        // 发现“下一个”按钮点击次数过多，停止点击（什么神级课能点那么多次）
        if (btnTipTimes >= 30) {
            console.log("发现“下一个”按钮点击次数过多，停止点击")
            alert("“下一个”按钮点击次数过多，脚本已停止运行\n\n一点小bug而已，请点击确认 刷新页面继续")
            location.reload(); // 刷新页面
            return false
        }
        // 点击下一个
        let btnTip = document.getElementsByClassName("btn-tip")
        btnTip[btnTip.length - 1].click()
        btnTipTimes++ // 计数
        return true
    }
    function clickBotton() {
        btn.removeEventListener('click', clickBotton); // 解除监听事件，避免重复点击
        setTimeout(function () {
            // 长时间不动会弹出提示框
            let noStudyTime = document.getElementById("noStudyTime") // 不学习提示框
            if (noStudyTime != null) {
                if (noStudyText != noStudyTime.innerText) {
                    console.log("===> 发现不学习君，干掉他")
                    document.getElementsByClassName("btn-submit")[0].click()
                    noStudyText = noStudyTime.innerText
                }
            }

            let vedioProgress = document.querySelector(".video-progress .text"); // 视频进度
            // const progress= vedioProgress.querySelector('span[data-bind="text: pageElement.record().viewProgress()"]')
            if (vedioProgress != null) {
                if (vedioProgress.innerText == '已看完') {
                    console.log("===> 播完了，下一个")
                    if (!clickNextBtn()) return // 点击下一个
                } else {
                    let vedioBtn = document.getElementsByClassName("mejs__overlay-button") // 播放按钮（视频进度存在，说明播放按钮也存在，不用判断了）
                    // 如果视频暂停播放，则点击播放【none播放中，block已暂停】
                    // todo: 暂停播放按钮   document.querySelector('[title="暂停"]').click()
                    // todo: 播放按钮       document.querySelector('[title="播放"]').click()
                    if (document.getElementsByClassName("mejs__overlay-play")[0].style.display != 'none') {
                        console.log("===> 团长：不要停下来啊")
                        vedioBtn[0].click() // 点击继续
                    }
                    console.log("===> 没播完，继续")
                }
            } else {
                // 视频进度不存在，说明不是视频页面
                let tittle = document.querySelector(".course-title").innerText // 标题
                // 标题为课后小测 就该停了
                if (tittle == '课后小测') {
                    console.log("===> 到达课后小测，是时候停了，接下来就交给你了")
                    alert("===> 到达课后小测，是时候停了，接下来就交给你了")
                    return
                } else {
                    // 既不是视频，也不是课后小测，直接过
                    console.log("===> 既不是视频，也不是课后小测，直接过，下一个")
                    if (!clickNextBtn()) return // 点击下一个
                }
            }
            btn.addEventListener("click", clickBotton) //监听按钮点击事件
            btn.click() // 定时任务继续
        }, 3000);
    }

    // 所谓静音，也不过是一直检测视频静音按钮的状态，还是会偶尔遗漏一两秒
    // let muteButtonTitle = '静音' // 默认为不开静音
    let muteButtonTitle = '取消静音' // 默认开静音
    const btn2 = createButton({
        text: muteButtonTitle, //按钮内容
        styles: {
            width: "50px",
            height: "50px",
            borderRadius: "15px", //按钮四个角弧度
            left: "200px",
            top: "100px"
        }
    });
    btn2.addEventListener("click", toggleMuteStatu) //监听按钮点击事件

    // 开启静音模式
    function turnOnMute() {
        console.log("===> 开启静音模式")
        muteButtonTitle = '取消静音'
        btn2.textContent = "取消静音";
    }
    // 关闭静音模式
    function turnOffMuting() {
        console.log("===> 关闭静音模式")
        muteButtonTitle = '静音'
        btn2.textContent = "静音";
    }
    // 切换静音状态
    function toggleMuteStatu() {
        const mejs__volume = document.getElementsByClassName("mejs__volume-button") // 音量控制
        // 判断静音按钮是否存在
        if (mejs__volume.length != 0) {
            let muteButton = mejs__volume[0].querySelector('button')
            muteButton.click()
            if (muteButton.title == '取消静音') { // 如果当前为静音状态
                turnOffMuting() // 关掉静音
            } else {
                turnOnMute() // 开启静音
            }
        }
    }
    // 保持静音或非禁音状态
    function maintainMuteStatus() {
        setTimeout(function () {
            const mejs__volume = document.getElementsByClassName("mejs__volume-button") // 音量控制
            // 判断视频的静音按钮是否存在
            if (mejs__volume.length != 0) {
                let muteButton = mejs__volume[0].querySelector('button')
                // 如果视频静音按钮当前静音状态不一致，则切换状态
                if (muteButton.title != muteButtonTitle) {
                    toggleMuteStatu()
                }
            }
            maintainMuteStatus()
        }, 5000);
    }
    maintainMuteStatus()

    // 自动开始
    window.onload = function () {
        setTimeout(function () {
            // 挂载
            var like_comment = document.body;
            like_comment.appendChild(btn);
            like_comment.appendChild(btn2);
            console.log("===> 脚本加载完毕，点击按钮开始快乐的一天")
            // todo: 瞬间跳转到没完成的页面
            // 使用 closest 找到最近的父元素
            // const chapterItem = document.querySelector('.page-name.cursor.active').closest('.chapter-item.audition')
            // if (chapterItem) {
            //   const notCompletePage = chapterItem.querySelectorAll(".page-name.cursor:not(.complete)")
            //   if (notCompletePage.length > 0) {
            //     notCompletePage[0].click()
            //   }
            // }
            // btn.click()
        }, 3000);
    }

    // 模拟鼠标移动
    function simulateMouseMove(x, y) {
        // 创建一个新的 MouseEvent 对象
        var event = new MouseEvent('mousemove', {
            view: window,
            bubbles: true,
            cancelable: true,
            clientX: x,
            clientY: y
        });
        // 触发事件
        document.dispatchEvent(event);
    }
    // 每隔一秒钟模拟一次鼠标移动
    const mousemove = setInterval(function () {
        // 随机生成一个新的坐标
        var x = Math.floor(Math.random() * window.innerWidth);
        var y = Math.floor(Math.random() * window.innerHeight);
        // 模拟鼠标移动到新的坐标
        simulateMouseMove(x, y);
    }, 3000);
    window.mousemove = function () { clearInterval(mousemove); }

    // todo: 视频秒数，长时间不动，自动alert('当前页面最好不要最小化等挂后台操作，否则浏览器为了节省资源会休眠网页')
    // document.querySelector('.mejs__currenttime')

})();